import React from 'react'

function FormField({type, name, value, onChange}){
    return (
        <div>
            <label>
                Nome da Categoria:
                <input
                    type="text"
                    value={value}
                    name="nome"
                    onChange = {onChange}
                />
            </label>
        </div>
    )
}

export default FormField
